import Vue from 'vue'
import Router from 'vue-router'
import Main from '@/components/Main'
import Login from '@/components/Login'
import NotFound from '@/components/NotFound'


Vue.use(Router)
export const router = new Router({
 mode: 'history',
 routes: [
   {
     path: '/',
     name: 'main',
     component: Main
   },
   {
     path: '/login',
     name: 'login',
     component: Login
   },
   {
     path: '/404',
     name: 'notfound',
     component: NotFound
   },
   {
     path: '*',
     redirect: '/404'
   }
 ]
})
